function calcula(){
	
	var n = document.getElementById("pokemon");
	a = n.value.toUpperCase();
	
	var selecionado = document.getElementById("selecionado");
	selecionado.innerHTML="";
	
	var resultado = document.getElementById("resultado");
	resultado.innerHTML="";
	
	for(k=0;k<nome.length;k++){

		if(a==nome[k].toUpperCase()){
			selecionado.innerHTML=mostrav(k);
			resultado.innerHTML=efetividade(type1[k],type2[k]);
			//t.innerHTML = tipo_efetivo(type1[k],type2[k]);
		}	
	}
	
}
function mostra(k){
	var a = '';
	a += '<div class="col-md-3" style="margin-bottom:15px"><table><tr><td align="center"><img width="100px" style="vertical-align:middle;  border-radius:15px; margin: 5px; background-image: url(\'pokemongo/pokedex.png\');" src="pokemongo/img/'+nome[k]+'.png"></td><td >';
	a += ' <b>#'+number[k]+' '+nome[k]+'</b><small> '+cp[k]+'</small><br>';
	a += '<span> <img width="25px" style="vertical-align:middle" src="pokemongo/img/Icon_'+type1[k]+'.png"> '+type1[k]+'</span><br>';
	if(type2[k]!='') a += '<span> <img width="25px" style="vertical-align:middle" src="pokemongo/img/Icon_'+type2[k]+'.png"> '+type2[k]+'</span>';
	a += '</td></tr></table></div>';
	return a;
}
