function efetividade(a,b){
	
	atk = new Array(nome.length);
	atkT = new Array(tipo.length);

	def = new Array(nome.length);


	
	for(k=0;k<nome.length;k++){
				
		a1 = 1;
		if(tipos[type1[k]][a]!=null) a1 = tipos[type1[k]][a];
		atk[k]=a1;
		
		if(b!=""){
			b1 = 1;
			if(tipos[type1[k]][b]!=null) b1 = tipos[type1[k]][b];
			atk[k] = a1*b1;
		}

		if(type2[k]!=""){
			a2 = 1;
			if(tipos[type2[k]][a]!=null) a2 = tipos[type2[k]][a];
			atk[k] = Math.max(atk[k],a2);
			
			if(b!=""){
				b2 = 1;
				if(tipos[type2[k]][b]!=null) b2 = tipos[type2[k]][b];
				atk[k] = Math.max(a1*b1,a2*b2);
			}
			
		}
		
	}
	
	for(k=0;k<tipo.length;k++){
		a1 = 1;
		if(tipos[tipo[k]][a]!=null) a1 = tipos[tipo[k]][a];
		atkT[k]=a1;
		
		if(b!=""){
			b1 = 1;
			if(tipos[tipo[k]][b]!=null) b1 = tipos[tipo[k]][b];
			atkT[k] = a1*b1;
		}

	}
		
	
	
	
	// Funcao para retornar o maior valor de um array
	Array.max = function(array) {
		return Math.max.apply(Math, array);
	};
	Array.min = function(array) {
		return Math.min.apply(Math, array);
	};
	maior = Array.max(atk);
	
	for(k=0;k<nome.length;k++){
			if(atk[k]==maior){
			a1 = 1;
			if(tipos[a][type1[k]]!=null) a1 = tipos[a][type1[k]];
			def[k] = a1;

			if(type2[k]!=""){
				a2 = 1;
				if(tipos[a][type2[k]]!=null) a2 = tipos[a][type2[k]];
				def[k] = a1*a2;
			}



			if(b!=""){
				b1 = 1;
				if(tipos[b][type1[k]]!=null) b1 = tipos[b][type1[k]];
				def[k] = Math.max(def[k],b1);

				if(type2[k]!=""){

					b2 = 1;
					if(tipos[b][type2[k]]!=null) b2 = tipos[b][type2[k]];
					def[k] = Math.max(a1*a2,b1*b2);
				}
			}
			
		}
		else def[k] = 100000;
	}
	
	menor = Array.min(def);
	
	a='<div width="100%" align="center"><br><br>Dano máximo causado de <b>'+Math.ceil(maior*100)+"%</b> por ataques do tipo";
	for(k=0;k<tipo.length;k++){
		if(maior==atkT[k]) a += '<span> <img width="25px" style="vertical-align:middle" src="pokemongo/img/Icon_'+tipo[k]+'.png"> '+tipo[k]+' </span>';
	}

	
	a+=" e dano sofrido de <b>"+Math.ceil(menor*100)+"%</b> ou menos para os pokémons abaixo<br><br></div>";
	
	
	
	for(k=0;k<nome.length;k++)if(atk[k]==maior&&def[k]==menor)a+=mostra(k);

	
	return a;
}

function efetiv(){
		
	atkF = new Array(nome.length).fill(0);
	atkTF = new Array(tipo.length).fill(0);

	for(j=0;j<nome.length;j++){
		
		a = type1[j];
		b = type2[j];
		
		atk = new Array(nome.length);
		atkT = new Array(tipo.length);

		def = new Array(nome.length);
	
		for(k=0;k<nome.length;k++){

			a1 = 1;
			if(tipos[type1[k]][a]!=null) a1 = tipos[type1[k]][a];
			atk[k]=a1;

			if(b!=""){
				b1 = 1;
				if(tipos[type1[k]][b]!=null) b1 = tipos[type1[k]][b];
				atk[k] = a1*b1;
			}

			if(type2[k]!=""){
				a2 = 1;
				if(tipos[type2[k]][a]!=null) a2 = tipos[type2[k]][a];
				atk[k] = Math.max(atk[k],a2);

				if(b!=""){
					b2 = 1;
					if(tipos[type2[k]][b]!=null) b2 = tipos[type2[k]][b];
					atk[k] = Math.max(a1*b1,a2*b2);
				}

			}

		}

		for(k=0;k<tipo.length;k++){
			a1 = 1;
			if(tipos[tipo[k]][a]!=null) a1 = tipos[tipo[k]][a];
			atkT[k]=a1;

			if(b!=""){
				b1 = 1;
				if(tipos[tipo[k]][b]!=null) b1 = tipos[tipo[k]][b];
				atkT[k] = a1*b1;
			}

		}




		// Funcao para retornar o maior valor de um array
		Array.max = function(array) {
			return Math.max.apply(Math, array);
		};
		Array.min = function(array) {
			return Math.min.apply(Math, array);
		};
		maior = Array.max(atk);

		for(k=0;k<nome.length;k++){
				if(atk[k]==maior){
				a1 = 1;
				if(tipos[a][type1[k]]!=null) a1 = tipos[a][type1[k]];
				def[k] = a1;

				if(type2[k]!=""){
					a2 = 1;
					if(tipos[a][type2[k]]!=null) a2 = tipos[a][type2[k]];
					def[k] = a1*a2;
				}



				if(b!=""){
					b1 = 1;
					if(tipos[b][type1[k]]!=null) b1 = tipos[b][type1[k]];
					def[k] = Math.max(def[k],b1);

					if(type2[k]!=""){

						b2 = 1;
						if(tipos[b][type2[k]]!=null) b2 = tipos[b][type2[k]];
						def[k] = Math.max(a1*a2,b1*b2);
					}
				}

			}
			else def[k] = 100000;
		}

		menor = Array.min(def);


		for(k=0;k<tipo.length;k++){
			if(maior==atkT[k]) atkTF[k]++;
		}


		for(k=0;k<nome.length;k++)if(atk[k]==maior&&def[k]==menor) atkF[k]++;
	}
	grafico([tipo,atkTF]);
	
	maiorT = Array.max(atkTF);
	maior = Array.max(atkF);
	
	a='<div width="100%" align="center"><br><br>Dano máximo causado a <b>'+maiorT+"</b> pokémons por ataques do tipo";
	for(k=0;k<tipo.length;k++){
		if(maiorT==atkTF[k]) a += '<span> <img width="25px" style="vertical-align:middle" src="pokemongo/img/Icon_'+tipo[k]+'.png"> '+tipo[k]+' </span>';
	}

	
	a+=" para os pokémons mais resistentes abaixo<br><br></div>";
	
	
	
	for(k=0;k<nome.length;k++)if(atkF[k]==maior)a+=mostra(k);

	
	return a;
	
}

function grafico(dados){
	dados = dados[0].map((col, i) => dados.map(row => row[i]));
	console.log(dados)
	google.charts.load('current', {packages: ['corechart', 'bar']});
google.charts.setOnLoadCallback(drawBasic);

function drawBasic() {

	var data = new google.visualization.DataTable();
	data.addColumn('string', 'Type');
	data.addColumn('number', 'Qt');
	data.addRows(dados);

      var chart = new google.visualization.ColumnChart(
        document.getElementById('chart_div'));

      chart.draw(data);
    }
}